<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        body {
            margin: 0;
            font-size: 5em;
            background-image: url("after.png");
        }

        .banner {
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            position: relative;
            overflow: hidden;
        }

        .banner::before {
            content: '';
            position: absolute;
            inset: 0;
            background-image: url('valentin-petrov-m-mal-01.jpg');
            background-size: cover;
            background-position: center;
            animation: bgZoomIn 4s ease-in-out 1 forwards;
            z-index: -1;
            pointer-events: none;
        }

        .banner::after {
            content: '';
            position: absolute;
            inset: 0;
            background-image: url('img/after.png');
            background-size: cover;
            background-position: top;
            transform: scale(2);
            animation: bgZoomOut 4s ease-in-out 1 forwards;
            z-index: -1;
            pointer-events: none;
        }

        @keyframes bgZoomIn {
            from {
                transform: scale(1.6);
            }
            to {
                transform: scale(1);
            }
        }

        @keyframes bgZoomOut {
            from {
                transform: scale(1);
            }
            to {
                transform: scale(2);
            }
        }

        svg path {
            fill: transparent;
            stroke: #fff;
            stroke-width: 0.5;
            stroke-dasharray: 50;
            stroke-dashoffset: 50;
            animation: textAnimation 6s ease-in-out 1 forwards;
        }

        @keyframes textAnimation {
            0% {
                stroke-dashoffset: 150;
            }
            80% {
                fill: transparent;
            }
            100% {
                fill: #fff;
                stroke-dashoffset: 0;
            }
        }

        /* New styles for logo */
        #logo {
            position: absolute;
            display: none; /* Initially hide the logo */
            width: auto;
            height: 10em; /* Adjust based on your design needs */
            animation: logoZoomIn 2s forwards; /* Animation for zoom in */
        }

        @keyframes logoZoomIn {
            from {
                transform: scale(0); /* Start from scale 0 (invisible) */
            }
            to {
                transform: scale(1); /* End at scale 1 (visible) */
            }
        }

        @media (max-width: 768px) {
    /* Style adjustments for mobile devices */
    body {
        font-size: 3em; /* Adjust font size for readability on mobile */
    }

    .banner {
        flex-direction: column; /* Stack content vertically */
        align-items: center; /* Center items */
    }

    /* Adjust SVG size for mobile screens */
    svg {
        width: 90%; /* Use a percentage width */
        height: auto; /* Maintain aspect ratio */
    }

    /* Adjust logo size for mobile screens */
    #logo {
        height: 8em; /* Set appropriate height */
        width: auto; /* Maintain aspect ratio */
        margin-top: 20px; /* Add some spacing on top */
    }

    /* Optionally hide some elements on smaller screens if necessary */
    .title {
        /* e.g., you can reduce opacity or change display properties */
        opacity: 0.8; /* Slightly faded on mobile */
    }
}
@media (max-width: 768px) {
    /* Style adjustments for mobile devices */
    body {
        font-size: 3em; /* Adjust font size for readability on mobile */
    }

    .banner {
        flex-direction: column; /* Stack content vertically */
        align-items: center; /* Center items */
    }

    /* Adjust SVG size for mobile screens */
    svg {
        width: 90%; /* Use a percentage width */
        height: auto; /* Maintain aspect ratio */
    }

    /* Style adjustments for SVG text */
    .svg-text {
        font-size: 2.5em; /* Adjust font size based on your design needs */
        fill: #fff; /* Change color if needed */
        font-family: Arial, sans-serif; /* Adjust font family */
    }

    /* Set spacing between text lines */
    .svg-text + .svg-text {
        margin-top: 0.5em; /* Optional: adjust spacing as needed */
    }

    /* Adjust logo size for mobile screens */
    #logo {
        height: 8em; /* Set appropriate height */
        width: auto; /* Maintain aspect ratio */
        margin-top: 20px; /* Add some spacing on top */
    }

    /* Optionally hide some elements on smaller screens if necessary */
    .title {
        opacity: 0.8; /* Slightly faded on mobile */
    }
}
